-- 导出  过程 northwind.CustOrderHist 结构
DROP PROCEDURE IF EXISTS `CustOrderHist`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `CustOrderHist`(
        IN `AtCustomerID` VARCHAR(5)
    )
BEGIN

SELECT ProductName,
    SUM(Quantity) as TOTAL
FROM Products P,
     `Order Details` OD,
     Orders O,
     Customers C
WHERE C.CustomerID = AtCustomerID
  AND C.CustomerID = O.CustomerID
  AND O.OrderID = OD.OrderID
  AND OD.ProductID = P.ProductID
GROUP BY ProductName;

END//
DELIMITER ;


-- 导出  过程 northwind.CustOrdersOrders 结构
DROP PROCEDURE IF EXISTS `CustOrdersOrders`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `CustOrdersOrders`(
        IN `AtCustomerID` VARCHAR(5)
    )
BEGIN
      SELECT OrderID,
	OrderDate,
	RequiredDate,
	ShippedDate
FROM Orders
WHERE CustomerID = AtCustomerID
ORDER BY OrderID;

END//
DELIMITER ;


-- 导出  过程 northwind.Employee Sales by Country 结构
DROP PROCEDURE IF EXISTS `Employee Sales by Country`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `Employee Sales by Country`(
        IN `AtBeginning_Date` DATETIME,
        IN `AtEnding_Date` DATETIME
    )
BEGIN
  SELECT Employees.Country,
         Employees.LastName,
         Employees.FirstName,
            Orders.ShippedDate,
            Orders.OrderID,
 `Order Subtotals`.Subtotal AS SaleAmount
FROM Employees
 JOIN Orders ON Employees.EmployeeID = Orders.EmployeeID
      JOIN `Order Subtotals` ON Orders.OrderID = `Order Subtotals`.OrderID
WHERE Orders.ShippedDate Between AtBeginning_Date And AtEnding_Date;

END//
DELIMITER ;


-- 导出  过程 northwind.LookByFName 结构
