DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `Sales by Year`(
        IN `AtBeginning_Date` DATETIME,
        IN `AtEnding_Date` DATETIME
    )
BEGIN

    SELECT Orders.ShippedDate,
	   Orders.OrderID,
	  `Order Subtotals`.Subtotal,
	  ShippedDate AS Year
FROM Orders  JOIN `Order Subtotals` ON Orders.OrderID = `Order Subtotals`.OrderID
WHERE Orders.ShippedDate Between AtBeginning_Date And AtEnding_Date;

END//
DELIMITER ;


