-- 导出  函数 northwind.MyRound 结构
DROP FUNCTION IF EXISTS `MyRound`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `MyRound`(
        `Operand` DOUBLE,
        `Places` INTEGER
    ) RETURNS double
    DETERMINISTIC
BEGIN

DECLARE x DOUBLE;
DECLARE i INTEGER;
DECLARE ix DOUBLE;

  SET x = Operand*POW(10,Places);
  SET i=x;
  
  IF (i-x) >= 0.5 THEN                   
    SET ix = 1;                  
  ELSE
    SET ix = 0;                 
  END IF;     

  SET x=i+ix;
  SET x=x/POW(10,Places);

RETURN x;


END//
DELIMITER ;


